# include<bits/stdc++.h>using namespace std;#define maxn 2001000#define ll long longll a[maxn];void solve(){    ll x,y;        scanf("%lld%lld",&x,&y);           ll p=__gcd(x,y);           ll q=x*y/p;           a[0]=0;             int l=1;                 for(int i=1;;i++)                 {                     a[l++]=x*i;                     if(x*i==q)break;                 }                 for(int i=1;;i++)                 {                     if(y*i==q)break;                     a[l++]=y*i;                 }                 sort(a,a+l);                 ll s=0;                     for(int i=1;i<l;i++)                     {                         if(i==l-1)                         {                             if(x>y)                             s+=a[i]-a[i-1];                         }                            else                            {                               if(a[i]%x==0) s+=a[i]-a[i-1];                            }                      }                       // cout<<q<<" "<<s<<endl;                     if(s==q-s)printf("Equal\n");                        else if(s>q-s)printf("Dasha\n");                               else printf("Masha\n");}int main(){    solve();} 
